export const PeticionPut = async (props) => {

    const data = {
        fistname : "Danny",
        lastname: "ddasdsa",   
        phone: "3333",
        address: "DOCDOC"
    }

    await fetch('http://localhost:80/php-mysql-flutter-crud/add.php',
    {
        
        method: "POST",
        body: data,
        //mode: 'cors',
        /*headers: {
            'Access-Control-Allow-Origin': 'http://localhost:8080',
        },*/
        
    }
  ).then(res => res.json())
  .catch(error => console.error('Error:', error))
  .then(response => console.log('Success:', response));
}
